import React from 'react';

function Cart({ items, removeFromCart, checkout }) {
  const total = items.reduce((sum, item) => sum + parseFloat(item.price), 0);

  return (
    <div style={{ 
      height: '100%',
      display: 'flex',
      flexDirection: 'column',
      padding: '24px',
      backgroundColor: 'rgb(250, 250, 250)'
    }}>
      <div style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        marginBottom: '24px'
      }}>
        <h2 style={{
          fontSize: '18px',
          fontWeight: '600',
          color: 'rgb(15, 23, 42)',
          letterSpacing: '-0.01em',
          margin: 0
        }}>Current Sale</h2>
        <span style={{
          fontSize: '14px',
          color: 'rgb(100, 116, 139)',
          fontWeight: '500'
        }}>{items.length} items</span>
      </div>

      <div style={{ 
        flex: 1,
        overflowY: 'auto',
        marginBottom: '24px'
      }}>
        {items.map((item, index) => (
          <div key={index} style={{ 
            display: 'flex', 
            justifyContent: 'space-between',
            alignItems: 'center',
            marginBottom: '12px',
            padding: '16px',
            backgroundColor: 'white',
            borderRadius: '12px',
            border: '1px solid rgb(226, 232, 240)'
          }}>
            <div style={{ flex: 1 }}>
              <span style={{ 
                fontSize: '14px',
                fontWeight: '500',
                color: 'rgb(15, 23, 42)',
                display: 'block',
                marginBottom: '4px'
              }}>
                {item.product.Product}
              </span>
              <span style={{ 
                fontSize: '13px', 
                color: 'rgb(100, 116, 139)',
              }}>
                {item.description}
              </span>
            </div>
            <div style={{ 
              display: 'flex', 
              alignItems: 'center',
              gap: '16px',
              marginLeft: '16px'
            }}>
              <span style={{ 
                fontSize: '14px',
                fontWeight: '500',
                color: 'rgb(15, 23, 42)',
              }}>
                €{parseFloat(item.price).toFixed(2)}
              </span>
              <button 
                onClick={() => removeFromCart(index)} 
                onMouseEnter={(e) => {
                  e.target.style.backgroundColor = 'rgb(254, 242, 242)';
                  e.target.style.borderColor = 'rgb(239, 68, 68)';
                  e.target.style.color = 'rgb(239, 68, 68)';
                }}
                onMouseLeave={(e) => {
                  e.target.style.backgroundColor = 'white';
                  e.target.style.borderColor = 'rgb(226, 232, 240)';
                  e.target.style.color = 'rgb(100, 116, 139)';
                }}
                style={{ 
                  width: '28px',
                  height: '28px',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  border: '1px solid rgb(226, 232, 240)',
                  borderRadius: '6px',
                  backgroundColor: 'white',
                  color: 'rgb(100, 116, 139)',
                  cursor: 'pointer',
                  transition: 'all 0.15s ease',
                  fontSize: '18px'
                }}
              >
                ×
              </button>
            </div>
          </div>
        ))}
      </div>

      <div style={{
        borderTop: '1px solid rgb(226, 232, 240)',
        paddingTop: '24px'
      }}>
        <div style={{ 
          display: 'flex', 
          justifyContent: 'space-between',
          marginBottom: '24px'
        }}>
          <span style={{
            fontSize: '15px',
            fontWeight: '500',
            color: 'rgb(15, 23, 42)'
          }}>Total</span>
          <span style={{
            fontSize: '15px',
            fontWeight: '600',
            color: 'rgb(15, 23, 42)'
          }}>€{total.toFixed(2)}</span>
        </div>
        <button 
          onClick={checkout}
          disabled={items.length === 0}
          onMouseEnter={(e) => {
            if (items.length) {
              e.target.style.backgroundColor = 'rgb(29, 78, 216)';
            }
          }}
          onMouseLeave={(e) => {
            if (items.length) {
              e.target.style.backgroundColor = 'rgb(37, 99, 235)';
            }
          }}
          style={{ 
            width: '100%',
            padding: '12px 24px',
            fontSize: '14px',
            fontWeight: '500',
            backgroundColor: items.length ? 'rgb(37, 99, 235)' : 'rgb(226, 232, 240)',
            color: items.length ? 'white' : 'rgb(148, 163, 184)',
            border: 'none',
            borderRadius: '8px',
            cursor: items.length ? 'pointer' : 'not-allowed',
            transition: 'all 0.15s ease'
          }}
        >
          Complete Sale
        </button>
      </div>
    </div>
  );
}

export default Cart;
